import React, { useState } from 'react';
import './book.css';

const BookingForm = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        service: '',
        date: '',
        time: '',
        message: ''
    });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        alert('Booking submitted!');
        // Here you'd send formData to your backend
    };

    return (
        <div className="booking-container">
            <h2>Book your Service</h2>
            <form onSubmit={handleSubmit} className="booking-form">
                <input type="text" name="name" placeholder="Your Name" required onChange={handleChange} />
                <input type="email" name="email" placeholder="Your Email" required onChange={handleChange} />
                <select name="service" required onChange={handleChange}>
                    <option value="">Select a Service</option>
                    <option value="cleaning">Cleaning</option>
                    <option value="plumbing">Plumbing</option>
                    <option value="electrician">Electrician</option>
                </select>
                <input type="date" name="date" required onChange={handleChange} />
                <input type="time" name="time" required onChange={handleChange} />
                <textarea name="message" placeholder="Additional Notes" onChange={handleChange}></textarea>
                <button type="submit">Submit Booking</button>
            </form>
        </div>
    );
};

export default BookingForm;
